pragma solidity 0.8.10;

library PriceHelper {

    function sortAndSplit(uint256[] memory arr) internal pure returns (uint256[] memory, uint256[] memory) {
        uint256[] memory uniqueElements = new uint256[](arr.length);
        uint256[] memory uniqueCounts = new uint256[](arr.length);
        uint256 uniqueCount;
        for (uint256 i ; i < arr.length; ) {
            bool isRepeated;
            for (uint256 j ; j < uniqueCount; ) {
                if (arr[i] == uniqueElements[j]) {
                    isRepeated = true;
                    unchecked{
                        uniqueCounts[j]++;
                    }
                    break;
                }
                unchecked{
                    ++j;
                }
            }
            if (!isRepeated) {
                uniqueElements[uniqueCount] = arr[i];
                uniqueCounts[uniqueCount] = 1;
                unchecked{
                    uniqueCount++;
                }
            }
            unchecked{
                ++i;
            }
        }
        uint256[] memory resultArr = new uint256[](uniqueCount);
        uint256[] memory resultCountArr = new uint256[](uniqueCount);
        for (uint256 i ; i < uniqueCount; ) {
            resultArr[i] = uniqueElements[i];
            resultCountArr[i] = uniqueCounts[i];
            unchecked{
                ++i;
            }
        }
        return (resultArr , resultCountArr);
    }
}
